    state = {
        loggedIn: ''    
    }
    componentDidMount = () => {
        const log = localStorage.getItem('user')
        if(log){
            this.setState({loggedIn: true})
        }
        else{
            this.setState({loggedIn: false})
        }
    }
    render(){
    return (
        <div className="container">
            <h1>This is my Navbar</h1>
            <SignedInLinks />
        </div>
    )
    }
}

export default Navbar
